import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { 
  MapPin, 
  Car, 
  Cloud, 
  Settings, 
  Play, 
  ArrowLeft,
  Zap,
  Leaf,
} from 'lucide-react';
import './SimulationSetup.css';

const SimulationSetup = () => {
  const navigate = useNavigate();
  const [selectedTrack, setSelectedTrack] = useState('');
  const [drivingMode, setDrivingMode] = useState('eco');
  const [weather, setWeather] = useState('clear');
  const [surface, setSurface] = useState('dry');
  const [modelVersion, setModelVersion] = useState('ppo');
  const [tracks, setTracks] = useState([]);
  const [models, setModels] = useState({});
  const [loading, setLoading] = useState(true);
  const [starting, setStarting] = useState(false);

  useEffect(() => {
    loadData();
  }, []);

  const loadData = async () => {
    try {
      setLoading(true);
      // Load tracks and models in parallel
      const [tracksResponse, modelsResponse] = await Promise.all([
        fetch('http://localhost:5000/api/tracks'),
        fetch('http://localhost:5000/api/models/available')
      ]);
      
      const tracksData = await tracksResponse.json();
      const modelsData = await modelsResponse.json();
      
      setTracks(tracksData);
      setModels(modelsData);
    } catch (error) {
      console.error('Failed to load data:', error);
      // Fallback data
      setTracks(['Catalunya', 'Spielberg', 'Silverstone', 'Monza', 'Spa']);
      setModels({
        'ppo': { name: 'PPO Multi-Track', description: 'Proximal Policy Optimization' },
        'sac': { name: 'SAC Single-Track', description: 'Soft Actor-Critic' }
      });
    } finally {
      setLoading(false);
    }
  };

  const handleStartSimulation = async () => {
    if (!selectedTrack) {
      alert('Please select a track');
      return;
    }

    setStarting(true);

    const config = {
      track: selectedTrack,
      model_version: modelVersion,
      user: 'web_user'
    };

    localStorage.setItem('simulationConfig', JSON.stringify(config));
    
    // Start the simulation immediately
    try {
      const response = await fetch('http://localhost:5000/api/simulation/start', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(config)
      });

      const result = await response.json();
      
      if (result.success || result.simulation_id) {
        localStorage.setItem('simulationId', result.simulation_id);
        navigate('/dashboard');
      } else {
        alert('Failed to start simulation: ' + (result.error || 'Unknown error'));
      }
    } catch (error) {
      console.error('Failed to start simulation:', error);
      alert('Failed to start simulation: ' + error.message);
    } finally {
      setStarting(false);
    }
  };

  return (
    <div className="simulation-setup">
      <div className="container">
        <div className="setup-header">
          <Link to="/" className="back-button">
            <ArrowLeft size={20} />
            Back to Home
          </Link>
          <h1 className="setup-title">Simulation Setup</h1>
          <p className="setup-description">Configure your eco-driving simulation parameters</p>
        </div>

        <div className="setup-content">
          <div className="setup-section">
            <div className="section-header">
              <MapPin size={24} />
              <h2>Track Selection</h2>
            </div>
            <div className="track-grid">
              {tracks.map(track => (
                <button
                  key={track}
                  className={`track-card ${selectedTrack === track ? 'selected' : ''}`}
                  onClick={() => setSelectedTrack(track)}
                >
                  <div className="track-image">
                    <div className="track-placeholder">
                      <MapPin size={32} />
                    </div>
                  </div>
                  <div className="track-info">
                    <h3>{track}</h3>
                    <div className="track-country">Racing Circuit</div>
                    <div className="track-details">
                      <span>Length: 4.5km</span>
                      <span>Turns: 14</span>
                    </div>
                  </div>
                </button>
              ))}
            </div>
          </div>

          <div className="setup-section">
            <div className="section-header">
              <Car size={24} />
              <h2>Driving Mode</h2>
            </div>
            <div className="mode-grid">
              <button
                className={`mode-card ${drivingMode === 'eco' ? 'selected' : ''}`}
                onClick={() => setDrivingMode('eco')}
                style={{ '--mode-color': '#00ff88' }}
              >
                <div className="mode-icon">
                  <Leaf size={24} />
                </div>
                <h3>Eco Mode</h3>
                <p>Maximum efficiency and fuel savings</p>
                <ul className="mode-characteristics">
                  <li>Optimized acceleration</li>
                  <li>Regenerative braking</li>
                  <li>Energy recovery</li>
                </ul>
              </button>
              <button
                className={`mode-card ${drivingMode === 'balanced' ? 'selected' : ''}`}
                onClick={() => setDrivingMode('balanced')}
                style={{ '--mode-color': '#ff6b35' }}
              >
                <div className="mode-icon">
                  <Zap size={24} />
                </div>
                <h3>Balanced</h3>
                <p>Efficiency meets performance</p>
                <ul className="mode-characteristics">
                  <li>Smart acceleration</li>
                  <li>Adaptive braking</li>
                  <li>Balanced approach</li>
                </ul>
              </button>
              <button
                className={`mode-card ${drivingMode === 'performance' ? 'selected' : ''}`}
                onClick={() => setDrivingMode('performance')}
                style={{ '--mode-color': '#ff1744' }}
              >
                <div className="mode-icon">
                  <Car size={24} />
                </div>
                <h3>Performance</h3>
                <p>Maximum speed and lap times</p>
                <ul className="mode-characteristics">
                  <li>Aggressive acceleration</li>
                  <li>Late braking</li>
                  <li>Speed optimization</li>
                </ul>
              </button>
            </div>
          </div>

          <div className="setup-section">
            <div className="section-header">
              <Cloud size={24} />
              <h2>Environment</h2>
            </div>
            <div className="conditions-grid">
              <div className="condition-group">
                <h3>Weather Conditions</h3>
                <div className="condition-options">
                  <button
                    className={`condition-option ${weather === 'clear' ? 'selected' : ''}`}
                    onClick={() => setWeather('clear')}
                  >
                    <Cloud size={20} />
                    <span>Clear</span>
                    <small>Optimal conditions</small>
                  </button>
                  <button
                    className={`condition-option ${weather === 'cloudy' ? 'selected' : ''}`}
                    onClick={() => setWeather('cloudy')}
                  >
                    <Cloud size={20} />
                    <span>Cloudy</span>
                    <small>Reduced visibility</small>
                  </button>
                  <button
                    className={`condition-option ${weather === 'rainy' ? 'selected' : ''}`}
                    onClick={() => setWeather('rainy')}
                  >
                    <Cloud size={20} />
                    <span>Rainy</span>
                    <small>Wet track conditions</small>
                  </button>
                </div>
              </div>
              <div className="condition-group">
                <h3>Track Surface</h3>
                <div className="condition-options">
                  <button
                    className={`condition-option ${surface === 'dry' ? 'selected' : ''}`}
                    onClick={() => setSurface('dry')}
                  >
                    <MapPin size={20} />
                    <span>Dry</span>
                    <small>Maximum grip</small>
                  </button>
                  <button
                    className={`condition-option ${surface === 'wet' ? 'selected' : ''}`}
                    onClick={() => setSurface('wet')}
                  >
                    <MapPin size={20} />
                    <span>Wet</span>
                    <small>Reduced grip</small>
                  </button>
                  <button
                    className={`condition-option ${surface === 'mixed' ? 'selected' : ''}`}
                    onClick={() => setSurface('mixed')}
                  >
                    <MapPin size={20} />
                    <span>Mixed</span>
                    <small>Variable conditions</small>
                  </button>
                </div>
              </div>
            </div>
          </div>

          <div className="setup-section">
            <div className="section-header">
              <Settings size={24} />
              <h2>AI Model</h2>
            </div>
            <div className="model-grid">
              {Object.entries(models).map(([key, model]) => (
                <button
                  key={key}
                  className={`model-card ${modelVersion === key ? 'selected' : ''}`}
                  onClick={() => setModelVersion(key)}
                >
                  <span>{key.toUpperCase()}</span>
                  <p>{model.name}</p>
                  <small>{model.description}</small>
                  {model.trained_tracks && (
                    <div className="model-tracks">
                      <small>Trained on: {model.trained_tracks.slice(0, 3).join(', ')}{model.trained_tracks.length > 3 ? '...' : ''}</small>
                    </div>
                  )}
                </button>
              ))}
            </div>
          </div>

          <div className="setup-actions">
            <button 
              className="start-simulation"
              onClick={handleStartSimulation}
              disabled={!selectedTrack || starting || loading}
            >
              <Play size={20} />
              {starting ? 'Starting...' : 'Start Simulation'}
            </button>
            {loading && (
              <div className="loading-indicator">
                <small>Loading tracks and models...</small>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default SimulationSetup;
